                    <h1 id="ContactHeader">Contact</h1>
                    <div>Alex Arnold</div>
                    <div>alexarnold@gmail.com</div>
                    <div>8943656990</div>
                    <iframe id="Facebook" src="https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2Fmaaxoindustries%2F&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId"  scrolling="no" frameborder="0" allowTransparency="true" allow="encrypted-media"></iframe>
                </div>
            </div>
        );
    }
}

export default Contact;
